class Solution {

    /**
     * @param String $s
     * @param Integer $k
     * @return Integer
     */
    function beautifulSubstrings($s, $k) {
        $n = strlen($s);
        $count = 0;
        $vowels = $consonants = 0;

        for ($i = 0; $i < $n; $i++) {
            $vowelCount = $consonantCount = 0;
            for ($j = $i; $j < $n; $j++) {
                if (in_array($s[$j], ['a', 'e', 'i', 'o', 'u'])) {
                    $vowelCount++;
                } else {
                    $consonantCount++;
                }
                if (($vowelCount == $consonantCount) && (($vowelCount * $consonantCount) % $k == 0)) {
                    $count++;
                }
            }
        }

        return $count;
    }
}
